ابن رجب: (اسْــألِ الله الثبات عَلَـى الديـن إِلى الممات: { إِنَّ الَّذِينَ قَالُوا رَبُّنَا اللَّهُ ثُمَّ اسْـتَقَامُوا}

الذين قالوا: ربنا الله كثير؛ ولكن أهل الاستقامة قليل. فالاستقامة والثبات، لا قدرة للعبد عليها بنفسه ؛ فلذلك يحتاج أن يسأل ربه)

"مجموع الرسائل" (٣٣٩/١)
